import React from "react";
import { useRef } from "react";
import Right from "../img/icon/right.svg"
import { Link } from "react-router-dom";

function index(){
    const slider = useRef(null);
    function SlideRight(){
        slider.current.scrollBy({
            left: 100,
        })
    }
    return(
        <div className={"main"}>
            <div className={"slider"} ref={"slider"}>
                <div className={"slide b"}>
                    <button className={"slider__btn"} onClick={SlideRight}><img className={"icon"} src={Right} /></button>
                    <Link to={'/lection'}>
                        <div className="slide__element">Lection</div>
                    </Link>
                </div>
                <div className={"slide r"}>
                    <Link to={'/practice'}>.
                        <div className="slide__element">Practice</div>
                    </Link>
                </div>
            </div>
        </div>
    );
}

export default index;
